import Items from './Items';
import './App.css';
import Item from './Item';
import React from 'react';

var idl=[];
var quantity=[];
var amt =0;


function Check(idl,amt,quantity){
  const elem =  (
      <div className="App">
      <h1>
       Billing
      </h1><br/>
      <form>
  <table class="table">

    <thead class="thead-dark">
      <tr>
        <th scope="col"></th>
        <th scope="col">Name</th>
        <th scope="col">Price</th>
        <th scope="col">quantity</th>
        <th scope="col">Amount</th>

      </tr>
    </thead>
    <tbody>
    {(idl).map(function(iter){
    return (
      <tr>
      <td><img src={Items[iter].img}/></td>
      <td>{Items[iter].name}</td>
      <td>{Items[iter].price}</td>
      <td>{quantity[iter]}</td>
      <td>{Items[iter].price *(quantity[iter]) }</td>
      </tr>
    );
  })}
  </tbody>
      <tr>
        <th scope="col">Total</th>
        <th scope="col"></th>
        <th scope="col">{amt}</th>
        <th scope="col"></th>
        <th scope="col"><button class="btn btn-success" >Pay</button></th>

      </tr>

  </table>
  </form>
      </div>
    );

    ReactDOM.render(elem, document.getElementById('root'));
    }



function goto(){

  var i=0;
 for(i=0;i<Items.length;i++){
var check = document.getElementById(Items[i].name);
var quant = document.getElementById(Items[i].key);

  if(check.checked === true){
    idl.push(i);
    quantity.push(quant);
    amt = amt + Items[i].price*quant;
  }
 }
console.log(idl,amt,quantity);
Check(idl,amt,quantity);

}


function App() {

  return (
    <div className="App">
    <h1>
     Food App Menu
    </h1><br/>
    <form>
<table class="table">

  <thead class="thead-dark">
    <tr>
      <th scope="col"></th>
      <th scope="col">Name</th>
      <th scope="col">Price</th>
      <th scope="col">quantity</th>
      <th scope="col">Add Item</th>

    </tr>
  </thead>
  <tbody>
{Items.map(function(NewItem){
  return (
    <Item 
    id= {NewItem.key}
    img= {NewItem.img}
    name= {NewItem.name}
    price={NewItem.price}
    />
  );
})}
</tbody>
    <tr>
      <th scope="col"></th>
      <th scope="col"></th>
      <th scope="col"><button class="btn btn-success" onClick={goto}>Check Out</button></th>
      <th scope="col"></th>
      <th scope="col"></th>

    </tr>

</table>
</form>
    </div>
  );
}
export default App;
